// src/components/PersonalInfo.jsx
function PersonalInfo() {
  const personalInfo = [
    { className: "text", content: <h2>Hi, I'm Ryan</h2> },
    { 
      className: "picture", 
      content: <img src="/images/IMG_0881.webp" alt="Ryan's headshot" /> 
    },
    { 
      className: "paragraph", 
      content: (
        <p>
          I am a computer science student at Montclair State University. I'm a senior and
          I'm currently looking for a summer internship this year to advance my career and
          develop new skills in a work environment.
        </p>
      ) 
    },
    { 
      className: "para2", 
      content: (
        <p>
          In my free time, I like to play video games, play sports with friends, and spend
          time with my family.
        </p>
      ) 
    }
  ];

  return (
    <section className="personalinfo">
      {personalInfo.map((item, index) => (
        <div key={index} className={item.className}>
          {item.content}
        </div>
      ))}
    </section>
  );
}

export default PersonalInfo;
